function displayWeatherDataMetric(weatherData) {
    const temp = document.querySelector('.temperature');
    const loc = document.querySelector('.location');
    const countrySpan = document.querySelector('.country');
    const tempFl = document.querySelector('.feels-like');
    const humiSpan = document.querySelector('.humidity');
    const windSpeedSpan = document.querySelector('.wind-speed')

    try{
        const cityName = weatherData.name;
        const countryCode = weatherData.sys.country;
        const temperature = weatherData.main.temp;
        const feelsLike = weatherData.main.feels_like;
        const humi = weatherData.main.humidity;
        const windSpeed = weatherData.wind.speed;

        loc.textContent = `${cityName}`;
        countrySpan.textContent = `, ${countryCode}`;
        temp.textContent = `${temperature} °C`;
        tempFl.textContent = `${feelsLike} °C`;
        humiSpan.textContent = `${humi}%`;
        windSpeedSpan.textContent = `${windSpeed} km/h`;

        weatherCondition(weatherData);

    } catch(error){
        console.error('Error displaying weather data:', error);
    }
}



